    constructor(props){
        super(props);
        this.state = {
       books: [
            {
                id: 0,
                title: 'arthur'
            },
            {
                id: 1,
                title: 'sam'
            }
        ]
    }
    }
test = this.state.books.map(()=> <h1 key={books.id}>{books.title}</h1>)
    render(){
        return(
            <Container>
                {test}
            </Container>
        );
    }
}

export default Books;
